`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?item ?itemLabel ?nb WHERE {
?item wdt:[property:occupation] wd:[entity:rugby union player] ;
wikibase:sitelinks ?nb .
FILTER ( ?nb > 1 )
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}`

`sparql
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT ?person ?personLabel (GROUP_CONCAT(DISTINCT ?positionLabel; separator=", ") AS ?positions) (GROUP_CONCAT(DISTINCT ?crimeLabel; separator=", ") AS ?crimes) WHERE {
?person wdt:[property:instance of] wd:[entity:human];
wdt:[property:position held] ?position;
wdt:[property:convicted of] ?crime.
OPTIONAL { ?person rdfs:label ?personLabel. FILTER(LANG(?personLabel) = "en"). }
OPTIONAL { ?position rdfs:label ?positionLabel. FILTER(LANG(?positionLabel) = "en"). }
OPTIONAL { ?crime rdfs:label ?crimeLabel. FILTER(LANG(?crimeLabel) = "en"). }
}
GROUP BY ?person ?personLabel
ORDER BY DESC(COUNT(DISTINCT ?crime)) ?crimes`

`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT (COUNT(?a) AS ?count) (MIN(?lat) AS ?min_lat) (MIN(?long) AS ?min_long) (MAX(?lat) AS ?max_lat) (MAX(?long) AS ?max_long) WHERE {
?a wdt:[property:located in the administrative territorial entity]+ wd:[entity:Paris] . # administrative territorial entity = Paris
?a p:[property:coordinate location] ?statement . # coordinate-location statement
?statement psv:[property:coordinate location] ?coordinate_node .
?coordinate_node wikibase:geoLatitude ?lat .
?coordinate_node wikibase:geoLongitude ?long .
{
SELECT ?a (COUNT(?a) AS ?count_stmt) WHERE {
?a wdt:[property:located in the administrative territorial entity]+ wd:[entity:Paris] .
?a p:[property:coordinate location] ?statement
} GROUP BY ?a HAVING (?count_stmt < 2)
}
SERVICE wikibase:label {
bd:serviceParam wikibase:language "en" .
}
}`

`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?party ?partyLabel ?firstDate ?total_MPs WITH {
SELECT ?party (MIN(?date) AS ?firstDate) (count(distinct ?mp) as ?total_MPs) WHERE {
?mp p:[property:position held] ?mpStatement . ?mpStatement ps:[property:position held] ?term . ?term wdt:[property:subclass of] wd:[entity:Member of Parliament].
?mpStatement pq:[property:start time] ?date.
?mpStatement pq:[property:parliamentary group] ?party.
wd:[entity:1935 United Kingdom general election] wdt:[property:point in time] ?1935elec . filter(?date >= ?1935elec)
}
GROUP BY ?party
} AS %parties WHERE {
INCLUDE %parties.
filter(?total_MPs = 1)
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
ORDER BY desc(?firstDate) ?partyLabel`

`sparql
PREFIX hint: <http://www.bigdata.com/queryHints#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>

SELECT ?date ?cumulativecount
{
hint:Query hint:optimizer "None".
{ SELECT ?milestonep (COUNT(?item) as ?cumulativecount)
WHERE
{
{ SELECT ?item { {
?item p:[property:different from] [ pq:[property:criterion used] wd:[entity:two people with the same date of birth and date of death] ; ps:[property:different from] ?item2 ]
FILTER( xsd:integer(strafter(str(?item),"Q")) > xsd:integer(strafter(str(?item2),"Q")) )
} } }
BIND( xsd:integer( substr(str(?item), 33)) as ?qid)
wd:[entity:QID milestone] p:[property:quantity] ?milestonep .
?milestonep ps:[property:quantity] ?milestone .
FILTER( ?milestone > ?qid )
}
GROUP BY ?milestonep
}
?milestonep pq:[property:point in time] ?date
}`

`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?proglang ?proglangLabel ?maxdate ?followers
WITH {
SELECT ?proglang (MAX(?date) as ?maxdate) WHERE {
?proglang wdt:[property:instance of] wd:[entity:programming language];
p:[property:social media followers] ?socialmedia.
?socialmedia ps:[property:social media followers] ?followers;
pq:[property:Twitter numeric user ID] ?twitter;
pq:[property:point in time] ?date.
}
GROUP by ?proglang
} AS %result
WHERE {
INCLUDE %result
?proglang wdt:[property:instance of] wd:[entity:programming language];
p:[property:social media followers] ?socialmedia.
?socialmedia ps:[property:social media followers] ?followers;
pq:[property:point in time] ?maxdate.
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
} ORDER BY DESC(?followers)`

