`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?awardLabel ?item ?itemLabel (GROUP_CONCAT(?winnerLabel; SEPARATOR = ", ") AS ?winners) ?work ?workLabel ?role ?roleLabel WHERE {
?item p:[property:award received] ?awardStatement.
?awardStatement ps:[property:award received] ?award;
pq:[property:statement is subject of] wd:[entity:92nd Academy Awards].
OPTIONAL { ?awardStatement pq:[property:winner] ?winner. }
OPTIONAL { ?awardStatement pq:[property:for work] ?work. }
OPTIONAL { ?awardStatement pq:[property:character role] ?role. }
SERVICE wikibase:label {
bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en".
?award rdfs:label ?awardLabel.
?item rdfs:label ?itemLabel.
?winner rdfs:label ?winnerLabel.
?work rdfs:label ?workLabel.
?role rdfs:label ?roleLabel.
}
}
GROUP BY ?awardLabel ?item ?itemLabel ?work ?workLabel ?role ?roleLabel`

`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
