SELECT ?item ?itemLabel ?adjacent ?adjacentL ?coords
{
?item wdt:[property:instance of]/wdt:[property:subclass of]* wd:[entity:metro station] ;
wdt:[property:connecting line] wd:[entity:Paris Métro Line 1] ;
wdt:[property:coordinate location] ?coords .
OPTIONAL {
?item p:[property:adjacent station] [ ps:[property:adjacent station] ?adjacent ; pq:[property:towards] wd:[entity:Château de Vincennes];
pq:[property:connecting line] wd:[entity:Paris Métro Line 1]] .
?adjacent rdfs:label ?adjacentL FILTER (lang(?adjacentL) = "en")
}
?item wdt:[property:date of official opening] ?founded_date. #needs existence
