`sparql
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX ontolex: <http://www.w3.org/ns/lemon/ontolex#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wikibase: <http://wikiba.se/ontology#>

select *
with {
select ?lang (count(*) as ?meaningless) {
?l dct:language ?lang;
wikibase:statements "0"^^xsd:integer.
minus { ?l ontolex:sense [] }
} group by ?lang
} as %meaningless
with {
select ?lang (count(*) as ?total) {
?l dct:language ?lang.
} group by ?lang
} as %totals
where {
include %meaningless.
include %totals.
filter (?total >= 10).
bind(?meaningless/?total*100 as ?pc).
?lang rdfs:label ?en filter(lang(?en) = "en").
} order by desc(?pc) desc(?total) ?en`

`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?item1 ?image ?item1Label ?item2 ?image2 ?item2Label ?edgeLabel
WITH { SELECT ?item1 WHERE {
VALUES ?item1 {wd:[entity:With a guitar. To Jane] wd:[entity:Percy Bysshe Shelley] wd:[entity:Shelley's guitar] wd:[entity:acoustic guitar] wd:[entity:Jane Williams] wd:[entity:Mary Shelley] wd:[entity:The Tempest] wd:[entity:William Shakespeare] wd:[entity:Bodleian Library] wd:[entity:Mary Shelley] wd:[entity:oil painting]}
} } AS %item1
WITH {SELECT (?item1 AS ?item2) WHERE {INCLUDE %item1} } AS %item2
WHERE {
INCLUDE %item1.
INCLUDE %item2.
?item1 ?prop ?item2.
?edge wikibase:directClaim ?prop ; a wikibase:[property:Property]
OPTIONAL {?item1 wdt:[property:image] ?image}
OPTIONAL {?item2 wdt:[property:image] ?image2}
SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}`

`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT ?q ?qLabel (GROUP_CONCAT(DISTINCT ?collectionLabel; separator="; ") AS ?where) ?enwp (GROUP_CONCAT(DISTINCT ?langLabel; separator=", ") AS ?languages) ?linkcount
WHERE { {SELECT ?q (COUNT(?sitelink) AS ?linkcount) WHERE { ?q (wdt:[property:instance of]/wdt:[property:subclass of]*) wd:[entity:manuscript]. ?sitelink schema:about ?q }
GROUP BY ?q }
?q p:[property:collection] ?s. ?s ps:[property:collection] ?collection . MINUS {?s pq:[property:end time] []}.
MINUS {?s ps:[property:collection] wd:[entity:Matenadaran] }
OPTIONAL{ ?q wdt:[property:language of work or name] ?lang }
SERVICE wikibase:label {
bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en".
?q rdfs:label ?qLabel. ?collection rdfs:label ?collectionLabel . ?lang rdfs:label ?langLabel
}
OPTIONAL{?enwp schema:about ?q ; schema:isPartOf <https://en.wikipedia.org/> }
# other props: inventory number; part of ; full work (P953); Commons cat; described at (P973)
}
GROUP BY ?q ?qLabel ?enwp ?linkcount
ORDER BY DESC(?linkcount)`

`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?person ?personLabel (URI(CONCAT("http://emlo.bodleian.ox.ac.uk/profile/person/",?emlo)) AS ?emlolink) ?birthyear (IF(isBLANK(?pob),"unknown",?pobLabel) AS ?birthplace) ?deathyear (IF(isBLANK(?pod),"unknown",?podLabel) AS ?deathplace)
WHERE {
?person wdt:[property:Early Modern Letters Online person ID] ?emlo;
OPTIONAL { ?person wdt:[property:date of birth] ?dob }
OPTIONAL { ?person wdt:[property:date of death] ?dod }
OPTIONAL { ?person wdt:[property:place of birth] ?pob }
OPTIONAL { ?person wdt:[property:place of death] ?pod }
BIND(YEAR(?dob) as ?birthyear)
BIND(YEAR(?dod) as ?deathyear)
SERVICE wikibase:label {
bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en,fr,de,nl,es,pl".
?pob rdfs:label ?pobLabel.
?pod rdfs:label ?podLabel.
?person rdfs:label ?personLabel
}
} ORDER BY DESC(?birthyear)`

`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?lighthouse ?lighthouseName ?countryLabel (concat(str(?latitude), ", ", str(?longitude)) AS ?coordinates) ?height ?builtDateLabel ?functionalLabel ?wikipediaUrl
WHERE
{
?lighthouse wdt:[property:instance of] wd:[entity:lighthouse]. # find all instances of lighthouse
?country wdt:[property:continent] wd:[entity:South America]. # find all instances of country in South America
?lighthouse wdt:[property:country] ?country. # find lighthouses in South American countries
OPTIONAL {
?lighthouse wdt:[property:country] ?country.
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}
OPTIONAL {
?lighthouse wdt:[property:coordinate location] ?coordinates.
BIND(xsd:float(STRAFTER(STR(?coordinates), "Point(")) AS ?longitude)
BIND(xsd:float(STRAFTER(STR(?coordinates), " " )) AS ?latitude)
}
OPTIONAL { ?lighthouse wdt:[property:height] ?height. }
OPTIONAL { ?lighthouse wdt:[property:inception] ?builtDate. }
OPTIONAL {
?lighthouse p:[property:published in]/ps:[property:published in] ?wikipediaUrl. # get the English Wikipedia page URL
FILTER (LANG(?wikipediaUrl) = '' || LANG(?wikipediaUrl) = 'en')
}
OPTIONAL {
?lighthouse p:[property:floruit] ?functionalClaim.
?functionalClaim ps:[property:floruit] ?functional.
BIND(IF(?functional, "Operational", "Not operational") AS ?functionalLabel)
}
OPTIONAL {
?lighthouse rdfs:label ?lighthouseName.
FILTER (LANG(?lighthouseName) = 'en')
}
OPTIONAL {
?lighthouse schema:description ?lighthouseName.
FILTER (LANG(?lighthouseName) = 'en')
}
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}
ORDER BY ?lighthouseName`

`sparql
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT ?item ?itemLabel ?annuaire_url ?siren
?portal ?portalLabel ?url WHERE {
?item wdt:[property:French public service directory ID] ?annuaire_id;
wdt:[property:open data portal] ?portal;
wdt:[property:SIREN number] ?siren;
rdfs:label ?itemLabel.
FILTER((LANG(?itemLabel)) = "[AUTO_LANGUAGE]")
?portal rdfs:label ?portalLabel.
FILTER((LANG(?portalLabel)) = "[AUTO_LANGUAGE]")
?portal wdt:[property:official website] ?url.
BIND(IRI(CONCAT('https://lannuaire.service-public.fr/',?annuaire_id)) as ?annuaire_url)
}`

`sparql
PREFIX bd: <http://www.bigdata.com/rdf#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?departement ?departementLabel ?form {
{ ?departement wdt:[property:instance of] wd:[entity:department of France] } UNION
{ ?departement wdt:[property:instance of] wd:[entity:territorial collectivity of France with special status] }
?departement wdt:[property:population] ?population ;
wdt:[property:geoshape] ?form ;
wdt:[property:shares border with] ?x .
FILTER NOT EXISTS {
?departement wdt:[property:shares border with] ?voisin .
{ ?voisin wdt:[property:instance of] wd:[entity:department of France] } UNION
{ ?voisin wdt:[property:instance of] wd:[entity:territorial collectivity of France with special status] }
?voisin wdt:[property:population] ?population_voisin .
FILTER (?population_voisin > ?population) .
}
SERVICE wikibase:label { bd:serviceParam wikibase:language "fr" . }
}
ORDER BY ?departementLabel`

`sparql
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX ontolex: <http://www.w3.org/ns/lemon/ontolex#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wikibase: <http://wikiba.se/ontology#>

SELECT DISTINCT ?l ?word ?len WHERE {
{
{
?l rdf:type ontolex:LexicalEntry;
dct:language wd:[entity:Swedish];
wikibase:lemma ?word.
}
UNION
{
?l rdf:type ontolex:LexicalEntry;
dct:language wd:[entity:German];
wikibase:lemma ?word.
}
}
BIND(STRLEN(?word) AS ?len)
?l wikibase:lexicalCategory wd:[entity:noun].
}
ORDER BY DESC (?len)
LIMIT 1000`

