PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX gas: <http://www.bigdata.com/rdf/gas#>

SELECT ?station ?stationLabel ?cds ?line ?trackLabel ?track ?image {
{SELECT * { SERVICE gas:service { gas:program gas:gasClass "com.bigdata.rdf.graph.analytics.BFS" ; gas:in wd:[entity:Brussels-South railway station] ; gas:linkType wdt:[property:adjacent station] ; gas:out ?station ; gas:out1 ?depth ; gas:out2 ?pred . } FILTER(?station != wd:[entity:Brussels-South railway station])
?station wdt:[property:coordinate location] ?cds ; wdt:[property:country] ?country .
VALUES ?country { wd:[entity:Belgium] wd:[entity:Luxembourg] wd:[entity:Netherlands] }#Be, Lu, NL
?station p:[property:adjacent station] ?adjST . ?adjST ps:[property:adjacent station] ?adj .
OPTIONAL { ?adjST pq:[property:connecting line] ?track .}
MINUS { ?station p:[property:instance of] [ ps:[property:instance of] wd:[entity:Netherlands]488 ; pq:[property:end time] [] ] . } #connections that are no longer
MINUS { ?adj p:[property:instance of] [ ps:[property:instance of] wd:[entity:Netherlands]488 ; pq:[property:end time] [] ] . }
?adj p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLatitude ?lat1 ; p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLongitude ?lon1 .
?station p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLatitude ?lat2 ; p:[property:coordinate location]/psv:[property:coordinate location]/wikibase:geoLongitude ?lon2 .
BIND(CONCAT('LINESTRING(', STR(?lon1), ' ', STR(?lat1), ',', STR(?lon2), ' ', STR(?lat2), ')') AS ?str) . BIND(STRDT(?str, geo:wktLiteral) AS ?line)}
}
OPTIONAL { ?station wdt:[property:image] ?image .}
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}`

